-- 테이블 springproject4.member 구조 내보내기
CREATE TABLE IF NOT EXISTS `member` (
  `idx` int NOT NULL AUTO_INCREMENT COMMENT '회원 고유번호',
  `member_id` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '회원 아이디(중복x)',
  `password` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '회원 비밀번호(암호화)',
  `nickname` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '회원 별명(중복x)',
  `name` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '회원 성명',
  `gender` varchar(2) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '회원 성별',
  `tel` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '전화번호(api, 중복x) 만약 이메일 인증 사용하면 null허용',
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '주소(api)',
  `email` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '이메일(api, 중복x) 만약 전화번호 인증 사용하면 null 허용',
  `like_team` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT '선택안함' COMMENT '좋아하는 팀 선택',
  `icon` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT 'noicon.jpg' COMMENT '회원 아이콘',
  `content` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT '회원 소개',
  `birthday` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '회원 생일',
  `member_info` char(3) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT '공개' COMMENT '정보 공개 여부(공개/비공개)',
  `delete_check` char(2) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT 'NO' COMMENT '탈퇴 신청 여부(OK/NO)',
  `point` int DEFAULT '0' COMMENT '포인트 최초가입시 1000포인트 지급, 하루에 1회 방문시 10포인트 증가,  ',
  `level` int DEFAULT '1' COMMENT '회원등급(일단 0:관리자 1:회원 10:비회원 100:차단된회원 )',
  `visit_count` int DEFAULT '0' COMMENT '방문 수',
  `board_count` int DEFAULT '0' COMMENT '작성 게시글 수',
  `comment_count` int DEFAULT '0' COMMENT '작성 댓글 수',
  `report_count` int DEFAULT '0' COMMENT '신고 누적 수(신고 누적 시 제재 가능)',
  `warning_count` int DEFAULT '0' COMMENT '경고 누적 수',
  `ip` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '0' COMMENT '접속IP(암호화)',
  `start_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '최초 가입일',
  `last_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '마지막 접속일',
  PRIMARY KEY (`idx`) USING BTREE,
  UNIQUE KEY `tel` (`tel`) USING BTREE,
  UNIQUE KEY `member_id` (`member_id`) USING BTREE,
  UNIQUE KEY `email` (`email`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

